import React, { Component } from 'react';

export default class Footer extends Component{

    render(){
        return (
            <div id="Footer" class="footer">
                <div class="footer-container w-container">
                    <div class="footer-wrapper-top">
                        <a href="/" class="hood-food-guide-link w-inline-block w--current">
                            <img src="/static/images/Hood-grey-2.png" width="160" height="44" alt="" class="hood-food-guide-logo"/>
                        </a>
                        <a href="mailto:contact@hoodfoodguide.com" class="link">Contact</a>
                        <a href="https://instagram.com/hoodfoodguide" target="_blank" rel="noopener noreferrer" class="Footer__InstagramLink-sc-1mb098p-0 bBdLAF">
                            <img src="/static/svg/instagram.svg"/>
                        </a>
                        <div class="text-block">Â© 2019 Hood Food Guide</div>
                    </div>
                </div>
            </div>
        );
    }
}
